import React, { useEffect } from 'react'
import ButtonTest from '../components/Button.js'
import Header from '../components/Header.js';
import Speechbubble from '../components/Speechbubble.js';
import aki from '../img/aki.jpg';

const HomeView = () => {

  function handleClick() {console.log("hej")};

  //function handleClick2() {console.log("jawn")};
  return(

      <div>
        <Header/>

        <span className="mainContent"> 
          <Speechbubble/> 
          <img src={aki} className="aki"></img>
        </span>

        <ButtonTest onClick={handleClick}/>

      </div>


  );

}


export default HomeView
